con:configuration.scriptText:
//imports
import groovy.json.JsonSlurper

//grab the response
def ResponseMessage = messageExchange.response.responseContent
//define a JsonSlurper
def jsonSlurper = new JsonSlurper().parseText(ResponseMessage)
def i = 0

def act_lab = messageExchange.modelItem.testCase.testSuite.project.getPropertyValue("label") 

log.info ("Expected Label: " + act_lab) 

while (jsonSlurper."1".id[i]!=null){

//def read_c = jsonSlurper.id[i]

def read_c = jsonSlurper."1".children[i]

if(read_c==null){
// Do nothing
//log.info("No childrens")
}
else{
def j = 0
def k = 1
while(read_c.label[j]!=null){

def read_d = read_c.label[j]


if (read_d == act_lab ){
assert read_d == act_lab
log.info(" Actual Label: [" + read_d + "] single occurance, counter: " + k )
assert k == 1
k++
}

j++

}
}
i++
}

